            <div class="div-block-108">
              <h3 class="heading-45">Om oss</h3>
              <div class="div-block-136"></div>
              <p class="paragraph-3">Vi er en utfordrende og fremoverlent bedrift som finner glede i å levere varige løsninger til din bedrift. Ved å benytte oss av nytenkende prosesser er vi tilpasningsdyktige og stolte av vår evne til å følge skiftninger i markedet.<br><br>Vi er stolte av å kunne tilby markedsledende produkter og tjenester, i et marked som stadig er i endring. Våre eksperter i våre datterselskaper, finner du nedenfor.</p>
            </div>
          </div>
          <div data-w-id="Div Block 12" style="opacity:0" class="div-block-107"></div>
        </div>
      </div>
    </div>
    <div class="verdier-section">
      <div class="image-holder-2"></div>
      <div data-w-id="Div Block 5" class="verdier-container">
        <div class="div-block-78">
          <div class="header-2">
            <h1 class="heading-42">Våre verdier</h1>
          </div>
          <div class="grid-holder">
            <div class="w-layout-grid grid-2">
              <div class="div-block-109 _1">
                <div class="div-block-110">
                  <h3 class="heading-46">Fremoverlente</h3>
                  <div class="div-block-136"></div>
                  <p class="paragraph-4">I et ungt og dynamisk arbeidsmiljø mener vi det er viktig å ha en fremoverlent tilnærming til salgsprosesser og arbeidsoppgaver. I dette legger vi at arbeidstakere selv har mulighet for å ta initiativ og fatte besluttninger, noe som gir rom for feilsteg og læring. En fremoverlent kultur på arbeidsplassen skal være med på skape karakter, arbeidstempo og innsatsvilje.<br></p>
                </div>
              </div>
              <div class="div-block-109 _2">
                <div class="div-block-110">
                  <h3 class="heading-46">Kompetente</h3>
                  <div class="div-block-136"></div>
                  <p class="paragraph-4">Vi er alltid på søken etter å forbedre kompetansenivået vårt som organisasjon, så vel som på individ nivå. Filosofien “sammen står vi sterke” skal sette rammer for teoretiske og praktiske utfordringer. Det er viktig for oss at en arbeidshverdag i Change group gir grobunn for læring og kompetanseløft, noe som gir våre kunder og samarbeidspartnere merverdi. <br></p>
                </div>
              </div>
              <div id="w-node-cdd3760c-7160-15ce-4b54-cbdb0cc2cedd-b2f41955" class="div-block-109 _3">
                <div class="div-block-110">
                  <h3 class="heading-46">Løsningsorienterte</h3>
                  <div class="div-block-136"></div>
                  <p class="paragraph-4">Med oppstart og SMB markedet som vårt hovedsegment faller det seg naturlig og ha en løsningsorientert tilnærming til hvordan et kundeforhold skal opprettholdes både når det gjelder arbeidsflyt og belastning for våre tjenester. Sammen skal vi i felleskap finne de beste og mest bærekraftige løsningene for et sunt og fruktbart samarbeid på lang sikt.</p>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    </div>
